import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The view toggle controls are not on the homepage. We must navigate to a
    // category or search results page first. We'll click a category card.
    const categoryCard = page.locator('.category-card:has-text("Electronics")');
    await categoryCard.waitFor({ state: 'visible' });
    await categoryCard.click();

    // Wait for the category page to load and the view controls to be visible.
    await page.waitForSelector('.sort-filter-controls', { state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page_loaded.png'));

    // Locate and click the "List View" button using its title attribute for specificity.
    const listViewButton = page.locator('button[title="List View"]');
    await listViewButton.click();

    // Verify the view has changed by waiting for the products container to get the '.products-list' class.
    const productListContainer = page.locator('.products-list');
    await productListContainer.waitFor({ state: 'visible' });

    // Take a final screenshot to confirm the list view is active.
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view_active.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view_active.png'));

    // Extract data to verify the task was completed successfully.
    const containerClass = await productListContainer.getAttribute('class');
    const isButtonActive = await listViewButton.evaluate(node => node.classList.contains('active'));

    return {
      success: true,
      action: "Switched product view from grid to list mode.",
      extractedData: {
        finalProductContainerClass: containerClass,
        isListViewButtonActive: isButtonActive,
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
